import { Link } from 'react-router-dom'
import { useEffect, useState } from 'react';
import axios from 'axios';


const baseurl = 'http://127.0.0.1:8000/api/teachers/'

function TeacherRegister() {
  const [teacherData, setTeacherData]=useState({
    'full_name':'',
    'email':'',
    'password':'',
    'qualification':'',
    'phone':'',
    'skills':'',
  });
  // Update elements value
  const handleChange=(event)=>{
    // console.log(event.target.name,event.target.value);
    setTeacherData({
      ...teacherData,
      [event.target.name]:event.target.value
    });
  }
  // End update elements value
  // Submit form
  const submitForm=()=>{
    const teacherFormData = new FormData();
    teacherFormData.append("full_name", teacherData.full_name)
    teacherFormData.append("email", teacherData.email)
    teacherFormData.append("password", teacherData.password)
    teacherFormData.append("qualification", teacherData.qualification)
    teacherFormData.append("phone", teacherData.phone)
    teacherFormData.append("skills", teacherData.skills)
    console.log(teacherFormData);
    try{
      axios.post(baseurl, teacherFormData).then((response) => {
        console.log(response.data);
      });
    } catch(error) {
      console.log(error)
    }
    
  };
  // End Submit form
  useEffect(() => {
    document.title = 'Teacher Register';
  });
    return(
        <div className='container mt-4'>
            <div className='row'>
                <div className='col-6 offset-3'>
                    <div className='card'>
                        <h5 className='card-header'>Teacher Register</h5>
                        <div className='card-body'>
                        <form>
                          <div className="mb-3">
                            <label for="fullName" className="form-label">Full Name</label>
                            <input onChange={handleChange} name="full_name" id="full_name" type="text" className="form-control" />
                          </div>
                          <div className="mb-3">
                            <label for="email" className="form-label">Email</label>
                            <input onChange={handleChange} name="email" id="email" type="email" className="form-control" />
                          </div>
                          <div className="mb-3">
                            <label for="password" className="form-label">Password</label>
                            <input onChange={handleChange} name="password" id="password" type="password" className="form-control" />
                          </div>
                          <div className="mb-3">
                            <label for="qualification" className="form-label">Qualifications</label>
                            <input onChange={handleChange} name="qualification" id="qualifications" type="text" className="form-control" />
                          </div>
                          <div className="mb-3">
                            <label for="phoneNumber" className="form-label">Phone Number</label>
                            <input onChange={handleChange} name="phone" id="phone" type="number" className="form-control" />
                          </div>
                          <div className="mb-3">
                            <label for="skills" className="form-label">Skills</label>
                            <textarea onChange={handleChange} name="skills" id="skills" className='form-control'></textarea>
                            <div id="skillsHelp" className="form-text">Fashion, Programming, Music, Gaming, etc.</div>
                          </div>
                          <button onClick={ submitForm } type="submit" className="btn btn-primary float-end">Register</button>
                        </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default TeacherRegister;
